var faceDictionary={};
for(i=0;i<faceArray.length;i++){
	faceDictionary[faceArray[i].fileName] = faceArray[i].fileUrl;
}
function ExpressionIconList( divName, iconsPerPage, sizePoint ){
	this.entity = document.getElementById( divName );
	this.entity.style.overflow = "hidden";
	if( !this.entity ){
		console.log( "表情列表初始化失败" );
		return null;
	}
	this.curruntPage = 1;
	this.iconsPerPage = iconsPerPage;
	if( sizePoint && sizePoint.length == 2 && sizePoint[0] > 0 && sizePoint[1] > 0 ){
		this.sizeString = "width='" + sizePoint[0] + "' height='" + sizePoint[1] + "'";
	}
	else{
		 this.sizeString = "";
	}
	this.flushPage = function(){
		var i;
		var imgString = "";
		for( i = 0; i < this.iconsPerPage; i++){
			var num = (this.curruntPage-1)*this.iconsPerPage+i;
			if( faceArray[num] ){
		  		imgString += "<img alt='" + faceArray[num].fileName +"' src='" + faceArray[num].fileUrl + "' onClick='insertExpressionIcon(" + num + ")' " + this.sizeString + "/>"
			}
		}
		this.entity.innerHTML = imgString;
	}
	this.hide = function(){
		this.entity.style.display="none";
	}
	this.show = function(){
		this.entity.style.display="";
	}
	this.pageDown = function(){
		this.curruntPage--;
		if(this.curruntPage <= 0 )this.curruntPage = 1;
		this.flushPage();
	}
	this.pageUp = function(){
		this.curruntPage++;
		if(this.curruntPage > this.totalPages() ){
			this.curruntPage = this.totalPages();
		}
		this.flushPage();
	}
	this.totalPages = function(){
		return Math.ceil( faceArray.length / this.iconsPerPage );
	}
	this.gotoPage = function( targetPageNumber ){
		this.curruntPage = targetPageNumber;
		if(this.curruntPage > this.totalPages() ){
			this.curruntPage = this.totalPages();
		}
		if(this.curruntPage <= 0 )this.curruntPage = 1;
		this.flushPage();
	}
}
function insertExpressionIcon( iconIndex ){
	try{
		expressionIconClick( "[emoji:" + faceArray[iconIndex].fileName + "]" );
	}
	catch(e){
	}
}
var inputAndOutputStrigAreaSize;
function ExpressionInputArea( divName, divWidth, divHeight, sizePoint ){
	this.entity = document.getElementById( divName );
	this.entity.style.overflow = "hidden";
	this.entity.innerHTML = '<div id="butelExpressInputTextfieldDiv" style="position:relative;height:25px;overflow:hidden;background-color:#EEE;"><textarea id="butelExpressInputTextfield" onKeyUp="butelExpressionInputSynchronous()"></textarea></div><div onClick="onExpressInputViewFocus()" id="butelExpressInputViewDiv" style="position:relative;top:-25px;width:' + divWidth + 'px;height:' + divHeight + 'px;border:#000; background-color:#FFF"></div>';
	if( !this.entity ){
		console.log( "带表情的输入框初始化失败" );
		return null;
	}
	if( sizePoint && sizePoint.length == 2 && sizePoint[0] > 0 && sizePoint[1] > 0 ){
		inputAndOutputStrigAreaSize = "width='" + sizePoint[0] + "' height='" + sizePoint[1] + "'";
	}
	else{
		inputAndOutputStrigAreaSize = "";
	}
	this.appendExpression = function( expString ){
		if( expString.indexOf("[emoji:") != 0 )return;
		var expOtherName = expString.replace( /\[emoji:(.*)\]/, "$1" );
		if( !faceDictionary[expOtherName] )return;
		var inputTextArea = document.getElementById("butelExpressInputTextfield");
		inputTextArea.value += expString;
		butelExpressionInputSynchronous();
	}
	this.getText = function(){
		var inputTextArea = document.getElementById("butelExpressInputTextfield");
		return inputTextArea.value;
	}
	this.clear = function(){
		var inputTextArea = document.getElementById("butelExpressInputTextfield");
		inputTextArea.value = "";
		butelExpressionInputSynchronous();
	}
	this.translateToExpressionString = function( str ){
		return getViewString(str)[1];
	}
}
function onExpressInputViewFocus(){
	var butelExpressionInput = document.getElementById( "butelExpressInputTextfield" );
	butelExpressionInput.focus();
	butelExpressionInput.selectionStart = butelExpressionInput.selectionEnd = butelExpressionInput.value.length;
}
function butelExpressionInputSynchronous(){
	var inputTextArea = document.getElementById("butelExpressInputTextfield");
	var inputTextView = document.getElementById("butelExpressInputViewDiv");
	var chatString = inputTextArea.value;
	var tpAr = getViewString( chatString );
	if( tpAr[0] )var txString = tpAr[1];
	else{
		inputTextArea.value = tpAr[1];
		butelExpressionInputSynchronous();
		return;
	}
	onExpressInputViewFocus();
	if( inputTextView.innerHTML == txString )return;
	inputTextView.innerHTML = txString;
}
function getViewString( chatString ){
  	var tx = "";
	if( (chatString.lastIndexOf( "[emoji:" ) > chatString.lastIndexOf( "]" ) ) || (chatString.lastIndexOf( "[emoji:[" ) > chatString.lastIndexOf( "]]" ) ) ){//有表情被删
	  	var lastIndex = chatString.lastIndexOf( "[emoji:" );
		chatString = chatString.substr( 0, lastIndex );
		return [false,chatString];
	}
	while( true ){
		var index = chatString.indexOf( "[emoji:" );
		if( index < 0  ){
		  tx += chatString;
		  break;
		}
		tx += chatString.substr(0,index);
		chatString = chatString.substr(index);
		index = chatString.indexOf( "]" );
		var imo = chatString.substr(0,index+1);
		chatString = chatString.substr(index+1);
		imo = imo.replace( /\[emoji:(.*)\]/, "$1" );
		if( imo.indexOf("[") == 0 && chatString.indexOf("]") == 0 ){
			imo += "]";
			chatString = chatString.substr(1);
		}
		imgUrl = faceDictionary[imo];
		tx += "<img src='" + imgUrl + "' " + inputAndOutputStrigAreaSize + "/>";
	}
	return [true, tx];
}